import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';

function Nav() {
    const navStyle = {
        color: 'white'
    };

    return (
        <div>
            <nav className="nav-bar">
                <ul>
                    <Link to="/">
                        <li className="nav-link">Home</li>
                    </Link>
                    <Link to="/vocab">
                        <li className="nav-link">Vocabulary</li>
                    </Link>
                    <Link to="/">
                        <li className="nav-link">COMING SOON</li>
                    </Link>
                    <Link to="/">
                        <li className="nav-link">COMING SOON</li>
                    </Link>
                </ul>
            </nav>
        </div>
    );
}
export default Nav;
